import "semantic-ui-css/semantic.min.css";
import AdvocateDBoard from "./dashboards/AdvocateDBoard";
import A2JDBoard from "./dashboards/DBoardTemplate";
import LoginPage from "./login/LoginPage";
import { Switch, Route } from "react-router-dom";
import PrivateRoute from "./private-route";
import A2JRoute from "./a2j-route";
import React, { useState } from "react";
import { BrowserRouter as Router } from "react-router-dom";
import Auth0ProviderWithHistory from "./auth0-provider-with-history";

function App() {
  const [role, setRole] = useState(null);

  console.log(role);

  return (
    <div className="App">
      <Router>
        <Auth0ProviderWithHistory>
          <Switch>
            <PrivateRoute
              path="/advocate"
              component={AdvocateDBoard}
              role={role}
            />
            <A2JRoute path="/a2j" component={A2JDBoard} role={role} />
            <Route path="/" component={() => <LoginPage setRole={setRole} />} />
          </Switch>
        </Auth0ProviderWithHistory>
      </Router>
    </div>
  );
}

export default App;
